//funciones auxiliares
private void inicioBloque(){
	if(ts != null)
		pila.push(ts);
	ts= new TablaSimbolos(pila);
	System.out.println("\n<INICIO DE BLOQUE>");
}
private void finBloque(){
	if(pila.size() >0)
		ts = pila.pop();
	else
		ts=null;
	System.out.println("<FIN DE BLOQUE>\n");
}


